    `nImage`          smallint(6)                                              NOT NULL,
    `flag`            tinyint(1)                                               NOT NULL,
    `frameBossMove`   varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci  NOT NULL DEFAULT '[]',
    `frameBossAttack` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci  NOT NULL DEFAULT '[]',
    `info`            int(11)                                                  NOT NULL,
    `Img1`            varchar(2500) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]',
    `Img2`            varchar(2500) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]',
